import React from 'react';
import './Feature.css';

const Interface = () => {
  return (
    <div className="feature-container">
      <h1>User-friendly Web Interface</h1>
      <p>
        Our web interface is designed to be intuitive and accessible, allowing users
        to report garbage quickly and efficiently. With a simple layout and clear
        instructions, anyone can contribute to a cleaner city.
      </p>
    </div>
  );
};
